namespace RonSijm.FluidHumidifier.Factories.AppRunner;

public class ServiceFactory(string resourceName = null, Action<Humidifier.AppRunner.Service> factoryAction = null) : ResourceFactory<Humidifier.AppRunner.Service>(resourceName)
{

    internal InnerServiceHealthCheckConfigurationFactory HealthCheckConfigurationFactory { get; set; }

    internal InnerServiceInstanceConfigurationFactory InstanceConfigurationFactory { get; set; }

    internal InnerServiceEncryptionConfigurationFactory EncryptionConfigurationFactory { get; set; }

    internal InnerServiceServiceObservabilityConfigurationFactory ObservabilityConfigurationFactory { get; set; }

    internal InnerServiceSourceConfigurationFactory SourceConfigurationFactory { get; set; }

    internal InnerServiceNetworkConfigurationFactory NetworkConfigurationFactory { get; set; }

    protected override Humidifier.AppRunner.Service Create()
    {
        var serviceResult = CreateService();
        factoryAction?.Invoke(serviceResult);

        return serviceResult;
    }

    private Humidifier.AppRunner.Service CreateService()
    {
        var serviceResult = new Humidifier.AppRunner.Service
        {
            GivenName = InputResourceName,
        };

        return serviceResult;
    }
    public override void CreateChildren(Humidifier.AppRunner.Service result)
    {
        base.CreateChildren(result);

        result.HealthCheckConfiguration ??= HealthCheckConfigurationFactory?.Build();
        result.InstanceConfiguration ??= InstanceConfigurationFactory?.Build();
        result.EncryptionConfiguration ??= EncryptionConfigurationFactory?.Build();
        result.ObservabilityConfiguration ??= ObservabilityConfigurationFactory?.Build();
        result.SourceConfiguration ??= SourceConfigurationFactory?.Build();
        result.NetworkConfiguration ??= NetworkConfigurationFactory?.Build();
    }

} // End Of Class

